// Homepage.js

import React, { useState } from 'react';
import DisplaySongs from './DisplaySongs';

function Homepage({ setSelectedSong, goToSidebar }) {
  return (
    <div>
      <h1>Welcome to the Music App</h1>
      <DisplaySongs onSongClick={(song) => setSelectedSong(song)} />
      <button onClick={goToSidebar}>Go to Sidebar</button>
    </div>
  );
}

export default Homepage;
